import React from 'react';

export default function TestButton() {
    const writeJsonFile = require('write-json-file');
    const data = { "status": "A" }
    return (
        <div>

            <button onClick={
                () => {
                    writeJsonFile('testData.json', data);
                }
            }>
                {"json만들기"}
            </button>
        </div>
    )
}
